import {useState} from 'react';

export default function Focused(props) {
  const [focused, setFocused] = useState(props.focused)


  const renderFocusedList = () => {
    return focused[0][0].map((i, item) => (
      <div>{i.resources[0].data.name}</div>
    ))
  }

  return (
    <div style={{
      position: "absolute", 
      width: "33vw", 
      height: "85.5vh", 
      left: "65.5vw",
      top: "9.2vh"
    }}></div>
  )
}
